mapper.insert:
INSERT INTO tb_robot_info(

     id
     ,robot_code
     ,robot_name
     ,robot_ip
     ,robot_netmask
     ,robot_gateway
     ,robot_ssid
     ,robot_password
     ,robot_link_status
     ,robot_use_status
     ,robot_bind_status
     ,creater_id
     ,created_at
     ,updated_at
     ,time_stamp

) VALUES (

     NULL
     ,#{robotCode}
     ,#{robotName}
     ,#{robotIp}
     ,#{robotNetmask}
     ,#{robotGateway}
     ,#{robotSsid}
     ,#{robotPassword}
     ,#{robotLinkStatus}
     ,#{robotUseStatus}
     ,#{robotBindStatus}
     ,#{createrId}
     ,#{createdAt}
     ,#{updatedAt}
     ,#{timeStamp}

)

SELECT LAST_INSERT_ID() AS id

